import React from 'react';
import { useParams } from 'react-router-dom';

import { Test } from './test'

function switchSample(topic) {
  switch (topic) {
    case 'test': return {Test}
    default: return <></>
  }
}

function PayMenu() {
  const { topic } = useParams()

  return (
    <div>
      <h1>제발 좀 나와보삼</h1>
      {switchSample(topic)}
    </div>
  )
}

export default PayMenu;
